import React from "react";

const Login = () => (
  <nav className='login'>
    <h2>Inventory Login</h2>
    <p>Sign in to manage your store's inventory</p>
    <button classNam='github' onClick={() => this.props.authenticate("Github")}>
      Login With Github
    </button>
    <button
      classNam='facebook'
      onClick={() => this.props.authenticate("Facebook")}
    >
      Login With Facebook
    </button>
    <button
      classNam='twitter'
      onClick={() => this.props.authenticate("Twitter")}
    >
      Login With Twitter
    </button>
  </nav>
);

export default Login;
